import React, {useEffect, useState} from "react"

const [places, setPlaces] = useState([])

function Places(){    
useEffect(() => {
    fetch('http://localhost:9292/attractions')
    .then(resp => resp.json)
    .then(json => setPlaces(json))
}

)
return (
<h1>Oh, the Places You'll Go!</h1>
)
}

export default Places;
